          "comment": "Front-runs; six wins here and three times beaten under 1l this year; likely player",
          "spotlight": "Front-runner who's won six times on this course, at 7f, 6f and 5f, and her latest close second of seven last week was the third time she's been beaten less than a length this year; a likely player again.",
