          "comment": "Looked unlucky at Chepstow last month and had an excuse there last time; possibilities",
          "spotlight": "Dual C&D winner who looked an unlucky loser at Chepstow (6f, good) last month and he had an excuse when the blind was removed late there last time; can be a bit up and down but he's versatile regarding tactics and it wouldn't be a surprise if he made serious impact.",
          "medical": [],
          "quotes": [
            {
              "date": "2022-10-03",
              "horse": "Vape",
              "horse_id": "2957566",
              "race": "Download The At The Races App Handicap",
              "race_id": "820642",
              "course": "Windsor",
              "course_id": "crs_2418",
              "distance_f": "6",
              "distance_y": "1332",
              "quote": "I was concerned about the ground for Vape as I wanted it quicker. Perhaps we'll have a go on the all-weather now unless we can find decent ground on turf. He tries his best and is a pleasure to train. I know he played up at Chepstow last time and was withdrawn, but I don't think it was truly his fault - John Flint, trainer."
            },
            {
              "date": "2022-04-11",
              "horse": "Vape",
              "horse_id": "2957566",
              "race": "Download The At The Races App Handicap (Div I)",
              "race_id": "807458",
              "course": "Windsor",
              "course_id": "crs_2418",
              "distance_f": "6",
              "distance_y": "1332",
              "quote": "I fancied Vape. I think we had some bad luck at Chelmsford last time. I didn't realise how important it was for the blinds to stay on until the last minute. We took them off early and he chanced the stalls and we got left. The winner scooted in that day, but I felt we'd have been in the frame, and coming back to six furlongs on ground softer than good was ideal. He's nice. He's big, but can go on good to firm, so hopefully we can get one or two more wins out of him - John Flint, trainer."
            }
          ],
