          "comment": "Looks favourably treated on some of his form during the spring; interesting",
          "spotlight": "Turf winner for Jospeh O'Brien as a 3yo but went missing for 22 months after May 2023; was found to have an irregular heartbeat when running poorly at Yarmouth last time, but looks favourably treated on his fouth of 11 at Newcastle (1m2f, Tapeta) in March and his fourth of 14 at Chester last month; interesting.",
          "medical": [],
          "quotes": [
            {
              "date": "2022-09-13",
              "horse": "Saturn Five",
              "horse_id": "4440420",
              "race": "Irish Stallion Farms EBF Median Auction Maiden",
              "race_id": "821145",
              "course": "Punchestown",
              "course_id": "crs_5070",
              "distance_f": "9",
              "distance_y": "1980",
              "quote": "Saturn Five is tough and hardy, he's a big horse and still green. There should be a lot of improvement in him. Hopefully he is one for next year and that trip is probably his minimum - Brendan Powell, assistant trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Saturn Five",
              "horse_id": "4440420",
              "quote": "He joined us from Joseph O'Brien this spring having won a 1m1f maiden at Punchestown in the autumn. We had a little sighter with him first time out at Newbury last month over 1m2f on hock-deep ground and I thought he went okay, but he got the race the wrong way round. He is a real stayer with a future and off his current mark, which has been dropped 2lb since last time, he is one to keep on your side. I gave him his second run back last week at York over two furlongs further where he finished seventh. 28-05-23"
            }
          ],
