          "comment": "Gradually lost his way last year; plenty to prove on stable debut after 11 months off",
          "spotlight": "Completed a four-timer over 7f/1m on turf/AW between March and June 2023, but gradually lost his way last year; plenty to prove starting out for another new yard after 11 months off.",
          "medical": [],
          "quotes": [],
          "stable_tour": [
            {
              "horse": "Wildfell",
              "horse_id": "4274036",
              "quote": "He ran some massive races over the winter without quite getting his head in front. He missed the break on Good Friday at Chelmsford and gave the leaders about 20 lengths. He had no chance of winning but tried his best and finished sixth, flying home and being beaten only four lengths. Ascot last time was a little bit disappointing but I think he might have needed the run and the drop back to six furlongs wasn't ideal. I think there's more to come from him and he's dropping to an attractive mark. He won four in a row early last year for Peter Chapple-Hyam and the handicapper wasn't so kind to him after that, so it just took him a while to get back on his feet. He shouldn't be far away next time he runs. 21-06-24"
            }
          ],
