          "comment": "Six-time winner over trips ranging from 7f-1m4f, best effort this term over 1m at Limerick",
          "spotlight": "Six-time winner over trips ranging from 7f-1m4f; best effort this term over 1m when touched off from high draw at Limerick; left with fair bit to do at Fairyhouse; has missed four engagements in the last four weeks, for a variety of reasons.",
