          "comment": "11 time winner on Flat; some good runs for Rebecca Menzies; Limerick stable debut was okay",
          "spotlight": "11 time winner on the Flat; some good runs for Rebecca Menzies, highlighted by a selling handicap hurdle win last December and two placed efforts over 1m4f at Catterick in April; his stable debut 12 days ago at Limerick was okay when seventh of 12 (1m3f, good).",
          "medical": [],
          "quotes": [
            {
              "date": "2023-07-11",
              "horse": "Magnetic North",
              "horse_id": "1526582",
              "race": "Tote Fantasy Who's In Your Stable Claiming Race",
              "race_id": "845336",
              "course": "Tramore",
              "course_id": "crs_5200",
              "distance_f": "12",
              "distance_y": "2640",
              "quote": "That was my fourth win on Magnetic North, he's been a great servant to me, I rode my first winner on him. He's in the form of his life now. He loves that, dictating it and the tight bends around here really suited him - Adam Caffrey, jockey, talking to Racing TV"
            },
            {
              "date": "2023-05-19",
              "horse": "Magnetic North",
              "horse_id": "1526582",
              "race": "Donnybrook Apprentice Handicap",
              "race_id": "841385",
              "course": "Leopardstown",
              "course_id": "crs_4862",
              "distance_f": "12",
              "distance_y": "2640",
              "quote": "Magnetic North loves this ground. When he was a younger horse you would have said he wanted a bit of cut but he didn't want it today We weren't going to run him but I just felt that this track would suit and the trip as well - Ado McGuinness, trainer"
            },
            {
              "date": "2019-07-11",
              "horse": "Magnetic North",
              "horse_id": "1526582",
              "race": "Irish Stallion Farms EBF \"Nasrullah\" Handicap (Premier Handicap)",
              "race_id": "734669",
              "course": "Leopardstown",
              "course_id": "crs_4862",
              "distance_f": "10",
              "distance_y": "2200",
              "quote": "Magnetic North got away with the ground. We took the chance because it was a big pot so we will probably head to Galway now because we think he would prefer softer ground - Sheila Lavery, trainer."
            },
            {
              "date": "2019-06-08",
              "horse": "Magnetic North",
              "horse_id": "1526582",
              "race": "Racing Again At Navan July 13th Handicap",
              "race_id": "732548",
              "course": "Navan",
              "course_id": "crs_5018",
              "distance_f": "10",
              "distance_y": "2200",
              "quote": "We've always liked him and we were very excited about him last year as a three-year-old but he just had real niggly problems. I think he just needs a bit of juice. He ran in Gowran on Wednesday and Robbie said he kept galloping but he just couldn't pick up on the ground, whereas today he absolutely loved it. The ground might just be the key to him. It doesn't have to be soft but just like today, a little softer than good. I threw him into the Royal Hunt Cup at Ascot but he won't get in. I'll look for something similar and hope that it rains - Sheila Lavery, trainer"
            },
            {
              "date": "2018-05-25",
              "horse": "Magnetic North",
              "horse_id": "1526582",
              "race": "Irish Stallion Farms EBF Median Auction Maiden",
              "race_id": "703065",
              "course": "Leopardstown",
              "course_id": "crs_4862",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "Magnetic North is one we've always liked but he seemed to get stagefright as a two-year-old and first time this year at Gowran he didn't have a clue and was all over the place. Today he was much more professional and I hope he still has huge improvement in him - Sheila Lavery, trainer"
            }
          ],
