          "comment": "Dual-purpose mare with three wins on Flat; okay hurdle runs for new trainer this term",
          "spotlight": "Dual-purpose mare with three wins on the Flat; last win in this sphere came two years ago at the Curragh off a 5lb higher mark (1m6f, good); her two runs over hurdles for her new trainer this term have been okay; needs to come on again.",
