          "comment": "Midfield finish in last Flat run in September from 3lb higher; fair hurdle runs this year",
          "spotlight": "Her last run on the Flat came at Leopardstown last September when she finished in the mid-division of a big-field from a 3lb higher mark (1m5f, good); she won a Listed mares' hurdle at Punchestown over the winter before being well beaten in three Graded hurdle starts since then; has a chance.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-11-24",
              "horse": "Lot Of Joy",
              "horse_id": "4438521",
              "race": "Frontline Security Grabel Mares Hurdle (Listed Race)",
              "race_id": "882284",
              "course": "Punchestown",
              "course_id": "crs_5070",
              "distance_f": "18",
              "distance_y": "3960",
              "quote": "I think Lot Of Joy enjoyed being left alone in front and Paul [Townend, jockey] was happy with her. We didn't think she'd handle that ground, so it's good to know she can and that we can continue with her instead of putting her away. She could go to Leopardstown and I wouldn't mind stepping up in trip. She has to improve a bit but we'll give her the opportunity - Willie Mullins, trainer."
            },
            {
              "date": "2023-02-08",
              "horse": "Lot Of Joy",
              "horse_id": "4438521",
              "race": "Fairyhouse Schooling Races Mares Maiden Hurdle",
              "race_id": "832756",
              "course": "Fairyhouse",
              "course_id": "crs_4732",
              "distance_f": "16",
              "distance_y": "3520",
              "quote": "Lot Of Joy is learning to race like a jumping mare more than a Flat mare. She is settling better and jumping better. She is in the Mares Novices' Hurdle at Cheltenham and I would say that is where she is going next - Willie Mullins, trainer"
            }
          ],
          "stable_tour": [
            {
              "horse": "Lot Of Joy",
              "horse_id": "4438521",
              "quote": "She seems to be settling better now and it's good to know that she handles the sort of ground she ran on at Punchestown on Sunday. We were half thinking of putting her away, but she could go to Leopardstown at Christmas now and I wouldn't mind stepping her up in trip to two and a half miles. She has to improve, but we will give her the opportunity to do so. 25-11-24"
            },
            {
              "horse": "Lot Of Joy",
              "horse_id": "4438521",
              "quote": "She's a useful Flat performer, and after finishing second in her first two hurdles she got it all together last time at Fairyhouse with a nice winning performance. Watching her you can see that she's now starting to race like a jumping mare, as she's settling much better and her jumping is improving. She's very likely to take up her engagement in the Mares' Novices' Hurdle. 08-03-23"
            }
          ],
