          "comment": "Close second off 2lb higher last month; good runs over hurdles recently; not discounted",
          "spotlight": "A second over 1m2f from 2lb higher on good ground at Sligo is sandwiched between two seconds over hurdles, most recently at this track last month; she is a five time winner on the Flat and is 1lb lower than her last winning mark; not discounted",
          "medical": [],
          "quotes": [
            {
              "date": "2023-11-07",
              "horse": "Fratas",
              "horse_id": "4682854",
              "race": "Starting Point 3-Y-O Maiden Hurdle",
              "race_id": "853858",
              "course": "Fairyhouse",
              "course_id": "crs_4732",
              "distance_f": "16",
              "distance_y": "3520",
              "quote": "Fratas is a good hurdler, we have known that for a while. She had a hard season on the Flat and she deserves a break. She will be better on better ground, that was tough work today - Mick Mulvany, trainer"
            },
            {
              "date": "2023-10-04",
              "horse": "Fratas",
              "horse_id": "4682854",
              "race": "Irish Stallion Farms EBF Fillies & Mares Handicap",
              "race_id": "851052",
              "course": "Navan",
              "course_id": "crs_5018",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "Fratas is tough. I knew today, bringing her back in trip, that you'd have to stay. The first two went some gallop and I thought they might run out of petrol, but they didn't. She showed her toughness the whole way to the line. That's her fifth win since she joined me and you wouldn't know where we'd go after this - Mick Mulvany, trainer"
            },
            {
              "date": "2023-09-13",
              "horse": "Fratas",
              "horse_id": "4682854",
              "race": "Newtown Fillies Handicap",
              "race_id": "849270",
              "course": "Tramore",
              "course_id": "crs_5200",
              "distance_f": "12",
              "distance_y": "2640",
              "quote": "Fratas is a very tough and honest filly. I thought Jamie (Powell) gave her a great ride, we were going to track one or two of them and I said to him if there's no pace on to jump out in front. He got the inside berth which I think around here makes a big difference. She seems to be very versatile - Michael Mulvany, trainer, speaking on Racing TV."
            },
            {
              "date": "2023-06-26",
              "horse": "Fratas",
              "horse_id": "4682854",
              "race": "Bay Leaf Handicap",
              "race_id": "844401",
              "course": "Ballinrobe",
              "course_id": "crs_4550",
              "distance_f": "9.5",
              "distance_y": "2105",
              "quote": "Fratas had been poorly away so we did a lot of work on that and Gary is deadly from the front at tracks like this. I think she'll get further with time - Mick Mulvany, trainer."
            }
          ],
